values:
wouldnt it be interesting if the last five years of your life was recorded and you can sit back eat some popcorn and watch all the mistakes you've made and all of the memories then see how it brought you to the person you are now? I've been thinkin a lot lately and trying to re-cap on everything and its not that easy anymore so i came to the conclusion that i need to hire someone to follow me around with a video camera :P 


Anyways, today was gangster:D i went on a shopping spree FOR MYSELF! haha i went with kayluh, josh, greg, jenna, and her friends christine and uhhm . . bri? Kayluh blew her entire pay check :P <33 and i spent 100 :X haha oh well i never shop for myself other than food because well im a fat ass haha:X i got a bunch of stuff and i have to return and exchange a bunch of stuff because i was quite the impulse buyer :P then yesturday i went to the mall with felbster and got a shirt that says some call me the gangster of love ;) and i finally got mikaelas birthday present tehe and shes back from cali yay! i missed her:( Then tomorrow i get to see her and im helping her job hunt :) and she besta be employed after this >:| well thats pretty much it summers been good :D 


&hearts;
